import React from 'react';
import { Box, Typography } from '@mui/material';

function Settings() {
  return (
    <Box>
      <Typography variant="h4" gutterBottom>
        Settings
      </Typography>
      <Typography>
        Settings and configuration options coming soon...
      </Typography>
    </Box>
  );
}

export default Settings;
